insert  into `tb_delito`(`coddel`,`nomdel`,`desdel`,`usuregdel`,`fecregdel`,`estdel`) values (1,'No presenta','','admin','0000-00-00 00:00:00',1),(2,'Abandono de destino','EstÃ¡ tipificado en el cÃ³digo de justicia militar y consiste en abandonar o no retornar del permiso o franco al cuartel, base, unidad, dependencia o destacamento donde presta servicios.','admin','0000-00-00 00:00:00',1),(3,'Aborto','EstÃ¡ comprendido en delitos contra la vida el cuerpo y la salud y consiste en causar el aborto con el consentimiento de la gestante.','admin','0000-00-00 00:00:00',1),(4,'Aborto consentido','EstÃ¡ comprendido en delitos contra la vida el cuerpo y la salud y consiste en causar el aborto con el consentimiento de la gestante.','admin','0000-00-00 00:00:00',1),(112,'Abuso de Autoridad','Consiste en el abuso de sus atribuciones cometiendo u ordenando en perjuicio de alguien un acto arbitrario cualquiera.','admin','0000-00-00 00:00:00',1),(113,'Abuso de Autoridad (Omision y rehusamiento o retardo de actos oficiales)','Consiste en el abuso de sus atribuciones cometiendo u ordenando en perjuicio de alguien un acto arbitrario cualquiera. Asi mismo omite, rehusa o retarda alg?n acto de su cargo ilegalmente.','admin','0000-00-00 00:00:00',1),(114,'Actos contra el Pudor','El que sin propÃ³sito de practicar el acto sexual u otro anÃ¡logo, con violencia o grave amenaza comete un acto contrario al pudor en una persona.','admin','0000-00-00 00:00:00',1),(115,'APROPIACIÃ“N ILICITA','EstÃ¡ contemplado en Delitos Contra el Patrimonio y consiste en apropiarse indebidamente de un bien mueble, dinero o valor que ha recibido en calidad de depÃ³sito, guarda, comisiÃ³n, administraciÃ³n u otro titulo semejante que produzca obligaciÃ³n de entregar o devolver.','admin','0000-00-00 00:00:00',1),(116,'Asalto a Mano Armada','EstÃ¡ contemplado en delitos Contra el Patrimonio y consiste en apoderarse ileg?timamente de un bien mueble, total o parcialmente ajeno, para aprovecharse de Ã©l, substrayÃ©ndolo del lugar en que se encuentra mediante el empleo de violencia contra la vÃ­ctima.','admin','0000-00-00 00:00:00',1),(117,'Asociacion ilicita para delinquir','Consiste en formar parte de una agrupaciÃ³n de dos o mÃ¡s personas destinadas a cometer delitos con el fin de beneficiarse econÃ³micamente.','admin','0000-00-00 00:00:00',1),(118,'CONCUSIÃ“N','Cosiste en abusar del cargo, obligando o induciendo a una persona a dar o prometer indebidamente para si o para otro un bien o un beneficio patrimonial.','admin','0000-00-00 00:00:00',1),(119,'CORRUPCIÃ“N  DE FUNCIONARIOS','Consiste en diversa conductas como : cohecho impropio, cohecho propio, corrupciÃ³n pasiva de magistrados, corrupciÃ³n de auxiliares, negociaciÃ³n incompatible con el cargo, corrupciÃ³n activa de magistrados, trÃ¡fico de influencias, enriquecimiento ilÃ­cito o adjudicaciÃ³n de bienes decomisados.','admin','0000-00-00 00:00:00',1),(120,'Contrabando','EstÃ¡ contemplado en delitos tributarios y consiste a dedicarse a una actividad comercial sujeta a autorizaciÃ³n sin haber cumplido los requisitos que exijan las leyes o reglamentos; emplee, expenda o haga circular mercaderÃ­as y productos sin el timbre o precinto correspondiente, cuando deban llevarlo o sin acreditar el pago del tributo. Asi mismo utilice mercaderÃ­as exoneradas de tributos en fines distintos de los previstos en la ley exonerativa respectiva.','admin','0000-00-00 00:00:00',1),(121,'DAÃ‘OS SIMPLE','Consiste en el que daÃ±a, destruye o inutiliza un bien, mueble o inmueble, total o parcialmente ajeno.','admin','0000-00-00 00:00:00',1),(122,'DEFRAUDACIÃ“N  DE RENTAS','Consiste en el uso del engaÃ±o o de procedimientos semejantes que implican la existencia de una determinada maquinaciÃ³n del sujeto activo en contra del patrimonio.','admin','0000-00-00 00:00:00',1),(123,'Delitos Ambientales','\"Esta comprendido en los delitos contra los recursos naturales y el medio ambiente y consiste en el que, infringiendo las normas sobre protecci?n del medio ambiente, lo contamina vertiendo residuos s?lidos, l?quidos, gaseosos o de cualquier otra naturaleza por encima de los l?mites establecidos, y que causen o puedan causar perjuicio o alteraciones en la flora, fauna y recursos hidrobiol?gicos.\"\r','admin','0000-00-00 00:00:00',1),(124,'Delito contra el deber y dignidad de funci?n','Consiste en exigir dinero o cualquier ventaja econÃ³mica para hacer u omitir algo en violaci?n de sus obligaciones o aceptar regalos u otras ventajas a sabiendas de que les son hechas a fÃ­n de violar sus obligaciones.','admin','0000-00-00 00:00:00',1),(125,'Delito contra el honor sexual','Consiste en obligar a otra persona a practicar el acto sexual u otro anÃ¡logo.','admin','0000-00-00 00:00:00',1),(126,'Delito Contra el Orden Financiero y Monetario (Tr?fico de moneda falsa)','Consiste en introducir en el territorio de la RepÃºblica o poner en circulaciÃ³n monedas o billetes falsificados o alterados por terceros, asÃ­ como el que promueve tales actos, serÃ¡ reprimido con pena privativa de libertad no menor de cuatro ni mayor de diez aÃ±os y con ciento ochenta a trescientos sesenta y cinco dÃ­as multa.','admin','0000-00-00 00:00:00',1),(127,'Delito Contra el Pudor','Esta comprendido en delitos contra la libertad y consiste en el que sin propÃ³sito de practicar el acto sexual u otro anÃ¡logo, con violencia o grave amenaza comete un acto contrario al pudor en una persona.','admin','0000-00-00 00:00:00',1),(128,'DELITO CONTRA LA ADMINISTRACIÃ“N PÃšBLICA','Consiste en la turbaciÃ³n del normal funcionamiento de la administraciÃ³n pÃºblica por actos de intrusiÃ³n y de invasiÃ³n (usurpaciÃ³n de autoridad, tÃ­tulos y honores).','admin','0000-00-00 00:00:00',1),(129,'Delito contra la Ecolog?a ','\"Consiste en alterar, destruir la diversidad biol?gica de las ?reas naturales y medio ambiente protegidas.\"\r','admin','0000-00-00 00:00:00',1),(130,'Delito Contra la Fe Publica (falsedad gen?rica)','\"Consiste en cometer falsedad simulando, suponiendo, alterando la verdad intencionalmente y con perjuicio de terceros, por palabras, hechos o usurpando nombre, calidad o empleo que no le corresponde, suponiendo viva a una persona fallecida o que no ha existido o viceversa, ser? reprimido con pena privativa de libertad no menor de dos ni mayor de cuatro a?os.\"\r','admin','0000-00-00 00:00:00',1),(131,'Delito Contra la Funci?n Jurisdiccional ','\"Consiste en la turbaci?n concerniente al normal funcionamiento de la actividad judicial, respeto a la autoridad y decisiones judiciales.\"\r','admin','0000-00-00 00:00:00',1),(132,'Delito contra la Libertad Individual ','\"Consiste en privar a otra persona de la capacidad de decisi?n o autodeterminaci?n, esto es la libertad de obrar o de acturar de la persona de acuerdo a su libre arbitrio o a su voluntad.\"\r','admin','0000-00-00 00:00:00',1),(133,'Delito Contra la Patria Potestad ','\"Consiste en la substracci?n del menor,?asumiendo relaci?n parental o el que induce a un menor a fugar de la casa de sus padres o tutor.\"\r','admin','0000-00-00 00:00:00',1),(134,'Delito contra la salud p?blica','Consiste en la contaminaci?n y propagaci?n de sustancias alimenticias o medicinales destinadas al consumo humano.\r','admin','0000-00-00 00:00:00',1),(135,'Delito contra la seguridad Publica','\"Consiste en causar faltas arbritariamente descuidando la seguridad publica, omitiendo las precauciones necesarias para prevenir a los transe?ntes respecto a la existencia de un posible peligro de modo que importe el peligro para la seguridad p?blica.\"\r','admin','0000-00-00 00:00:00',1),(136,'Delito Contra la Tranquilidad P?blica ','\"Consiste en la turbaci?n del desenvolvimiento pacifico de la vida Civil, alterando el sosiego y buena correspondencia de unos con otros.\"\r','admin','0000-00-00 00:00:00',1),(137,'Delito Contra la Vida, el Cuerpo y la Salud','Consiste en causar daÃ±os o quitar la vida a otra persona.','admin','0000-00-00 00:00:00',0),(138,'Delito contra las buenas costumbres ','\"Consiste en realizar actos contrarios a la decencia p?blica como: maltrato de animales, hacer proposiciones inmorales, alcoholismo, destrucci?n de plantas.\"\r','admin','0000-00-00 00:00:00',1),(139,'Delito de Deberes de Funci?n ','Consiste en no cumplir con sus funciones o reglamentos recibiendo a ambio una retribuci?n.\r','admin','0000-00-00 00:00:00',1),(140,'Delito de Derechos de Autor','\"Prevee un conjunto de conductas que atentan contra los derechos intelectuales; as?, el tipo penal que contiene los delitos contra los derechos de autor y conexos, buscan prevenir y sancionar conductas que atentan contra bienes jur?dicos que tienen sustento constitucional, cual es, el derecho de autor.\"\r','admin','0000-00-00 00:00:00',1),(141,'Delito de Violencia y Resistencia a la Libertad','Consiste en impedir a una autoridad o funcionario p?blico a ejercer sus funciones o le obliga a practicar un determinado acto de sus funciones o le estorba en el ejercicio de ?stas.\r','admin','0000-00-00 00:00:00',1),(142,'Delito?Contra la Familia ','\"Consiste en contraer un nuevo matrimonio sin haber disuelto el anterior, es decir, el casado que contrae matrimonio, la conducta se agrava si es que el agente induce a error a la persona con quien contrae nuevo matrimonio, ahora bien el no casado que tiene conocimiento de que la presona con quien se va a casar es casado ser? reprimido con pena privativa de la libertad.\"\r','admin','0000-00-00 00:00:00',1),(143,'Delitos contra el patrimonio','\"El bien jur?dico protegido es el patrimonio, espec?ficamente la posesi?n que es un atributo del derecho de propiedad.\"\r','admin','0000-00-00 00:00:00',1),(144,'Deserci?n','\"Est? tipificado en el C?digo de Justicia Militar y consiste en abandonar o no retornar a la base, unidad, cuartel, dependencia  o destacamento donde cumple el servicio Militar .\"\r','admin','0000-00-00 00:00:00',1),(145,'Desobediencia','\"Est? tipificado en el C?digo de Justicia Militar y consiste en dejar de cumplir una orden de servicio sin causa justificada, asi como las ?rdenes e instrucciones de car?cter general y las que se hubieran dado en forma impersonal para cuando llegue el caso determinado de acatarlas.\"\r','admin','0000-00-00 00:00:00',1),(146,'Difamaci?n ','\"Est? tipificado en Delitos Contra el honor y consiste en atribuir a una persona, un hecho, una cualidad o una conducta que pueda perjudicar su honor o reputaci?n.\"\r','admin','0000-00-00 00:00:00',1),(147,'ENRIQUECIMIENTO ILICITO','\"consiste cuando el aumento del patrimonio y/o del gasto econ?mico personal del funcionario o servidor p?blico, en consideraci?n a su declaraci?n jurada de bienes y rentas, es notoriamente superior al que normalmente haya podido tener en virtud de sus sueldos o emolumentos percibidos, o de los incrementos de su capital, o de sus ingresos por cualquier otra causa l?cita.\"\r','admin','0000-00-00 00:00:00',1),(148,'Encubrimiento ','Est? tipificado en Delitos contra la Administraci?n de Justicia y consiste en substraer a una persona de la persecuci?n penal o de otra medida ordenada por la justicia.\r','admin','0000-00-00 00:00:00',1),(149,'Estafa ','\"Est? comprendido en delitos Contra el Patrimonio y consiste en el perjuicio patrimonial ajeno causado mediante enga?o, astucia, ardid o manteniendo en error al agraviado.\"\r','admin','0000-00-00 00:00:00',1),(150,'Estafa y otras defraudaciones','Consiste en el perjuicio patrimonial ajeno causado mediante enga?o, astucia, ardid u otra forma fraudulenta, induciendo o manteniendo en error al agraviado, procurando el autor un provecho econÃ³mico para si o para un tercero.','admin','0000-00-00 00:00:00',1),(151,'Exposici?n de peligro a personas','\"Est? comprendido en Delitos contra la Vida, el Cuerpo y la Salud y consiste en poner en peligro de muerte o de grave o inminente da?o a la salud de un menor o incapaz de valerse por si mismo.\"\r','admin','0000-00-00 00:00:00',1),(152,'Extorsion','\"Est? comprendido en delitos contra el patrimonio, que consite que mediante violencia, amenaza o manteniendo en reh?n a una persona, obliga a ?sta o a otra a otorgar al agente o a un tercero una ventaja econ?mica indebida o de cualquier otra ?ndole, ser? reprimido con pena privativa de libertad no menor de seis ni mayor de doce a?os.\"\r','admin','0000-00-00 00:00:00',1),(153,'FabricaciÃ³n, suministro o tenencia de materiales peligrosos','EstÃ¡ comprendido en delitos de peligro comun y consiste el que, ileg?timamente, fabrica, almacena, suministra o tiene en su poder bombas, armas, municiones o materiales explosivos, inflamables, asfixiantes o tÃ³xicos o sustancias o materiales destinados para su preparaciÃ³n, serÃ¡ reprimido con pena privativa de libertad','admin','0000-00-00 00:00:00',1),(154,'Falsa Denuncia','\"consiste en el que denuncia a la autoridad un hecho punible, a sabiendas que no se ha cometido, o el que simula pruebas o indicios de su comisi?n que puedan servir de motivo para un proceso penal o el que falsamente se atribuye delito no cometido o que ha sido cometido por otro.\"\r','admin','0000-00-00 00:00:00',1),(155,'Falsedad Gen?rica','\"Consiste en alterar, suponer o simular la verdad intencionalmente y con perjuicios de terceros, por palabras, hechos o usurpando nombres, calidad o empleo que no le corresponde, suponiendo viva a una persona fallecida o que no ha existido.\"\r','admin','0000-00-00 00:00:00',1),(156,'Falsificaci?n de documentos','\"Est? contemplado en Delitos Contra la fe P?blica y consiste en hacer en todo o en parte, un documento falso o adulterar uno verdadero que pueda dar origen a derecho u obligaci?n o servir para probar un hecho.\"\r','admin','0000-00-00 00:00:00',1),(157,'Falsificaci?n Ideol?gica','\"Est? comprendido en delitos contra la Fe P?blica y consiste en cometer falsedad, simulando, suponiendo, alterando la verdad intencionalmente y con perjuicios de terceros, por palabras, hechos o usurpando nombres, calidad o empleo que no le corresponde, suponiendo viva a una persona fallecida o que no ha existido o viceversa.\"\r','admin','0000-00-00 00:00:00',1),(158,'Faltas','Est?n considerados como actos antisociales que solo tiene penas restrictivas de derechos y multas; asimismo las faltas prescriben a los 6 meses\r','admin','0000-00-00 00:00:00',1),(159,'Fraude','\"Consiste en el uso del enga?o o de procedimientos semejantes que implican la existencia de una determinada maquinaci?n del sujeto activo, los casos pueden ser los siguientes: Simulaci?n de Juicio o empleo de otro fraude procesal, Abuso de firma en blanco extendiendo alg?n documento en perjuicio del firmante o de tercero, El comisionista o cualquier otro mandatario que altera cuentas, precios o condiciones de los contratos, Venta como bienes libres, los que son litigosos o estan embargados.\"\r','admin','0000-00-00 00:00:00',1),(160,'Fraude en la administracion de personas juridicas','\"Consiste en Proporcionar datos falsos relativos a la situaci?n de una persona  jur?dica o Usar en provecho propio, o de otro, el patrimonio de la persona.\"\r','admin','0000-00-00 00:00:00',1),(161,'Homicidio','Est? comprendido en delitos contra la Vida el Cuerpo y la Salud y consiste en quitar la vida a otra persona sin la intenci?n.\r','admin','0000-00-00 00:00:00',1),(162,'Homicidio Culposo','\"Est? contemplado en delitos Contra la Vida, el Cuerpo y Salud y consiste en quitar la vida a otra persona sin haber tenido la intenci?n de hacerlo.\"\r','admin','0000-00-00 00:00:00',1),(163,'Hurto','\"Consiste en apoderarse ileg?timamente de un bien mueble, total o parcialmente ajeno, substray?ndolo del lugar donde se encuentra.\"\r','admin','0000-00-00 00:00:00',1),(164,'Hurto Agravado','EstÃ¡ contemplado en delitos contra el Patrimonio y consiste en el perjuicio patrimonial ajeno substrayÃ©ndolo del lugar donde se encuentra.','admin','0000-00-00 00:00:00',1),(165,'Hurto Simple','\"Est? contemplado en delitos contra el Patrimonio y consiste, el que, para obtener provecho, se apodera ileg?timamente de un bien mueble, total o parcialmente ajeno, sustray?ndolo del lugar donde se encuentra, ser? reprimido con pena privativa de libertad no menor de uno ni mayor de tres a?os.\"\r','admin','0000-00-00 00:00:00',1),(166,'Imprudencia de conduccion Vehicular','\"Consiste en operar o maniobrar veh?culo motorizado, instrumento, herramienta, m?quina u otro an?logo, con total negligencia, ser? reprimido con pena privativa de libertad  e inhabilitaci?n (suspensi?n o cancelaci?n de la autorizaci?n para conducir cualquier tipo de veh?culo.)\"\r','admin','0000-00-00 00:00:00',1),(167,'Insulto al superior','Est? tipificado en el c?digo de justicia militar y consiste en maltratar a un superior en  empleo o mando con arma o cualquier otro instrumento  u objeto capaz de producir la muerte o lesiones aunque el atacado no sufra da?o alguno o tambi?n tratar al superior con palabras injuriosas o con ademanes inconvenientes.\r','admin','0000-00-00 00:00:00',1),(168,'Lesiones','\"Est? contemplado en delitos contra la vida, el cuerpo y la salud, consiste en causar da?os o heridas en el cuerpo o la salud de una persona\"\r','admin','0000-00-00 00:00:00',1),(169,'Lesiones Leves','\"El que causa a otro un da?o en el cuerpo o en la salud que requiera m?s de diez y menos de treinta d?as de asistencia o descanso, seg?n prescripci?n facultativa, ser? reprimido con pena privativa de libertad no mayor de dos a?os y con sesenta a ciento cincuenta d?as-multa.\"\r','admin','0000-00-00 00:00:00',1),(170,'Lesiones Culposas','Consiste en quitar la vida a otra persona sin la intenci?n o premeditaci?n.\r','admin','0000-00-00 00:00:00',1),(171,'Libertad sexual','\"Se entiende en definitiva, como el derecho de toda persona a ejercer la actividad sexual en libertad, es decir, la capacidad de actuaci?n sexual\"\r','admin','0000-00-00 00:00:00',1),(172,'Libramiento Indebido','\"De acuerdo al c?digo penal contiene 6 incisos : girar cheques sin fondo, girar a  sabiendas que al tiempo de su presentaci?n no podr? ser pagado, frustrar maliciosamente el pago de un cheque, revocar un cheque durante su plazo legal de presentaci?n  cobro,  suplantar al beneficiario?o al endosatario, endosar un cheque a sabiendas que no tiene previsi?n de fondos.\"\r','admin','0000-00-00 00:00:00',1),(173,'Maltrato Psicologico','\"Se basa en comportamientos intencionados, ejecutados desde una posici?n de poder y encaminados a desvalorizar, producir da?o ps?quico, destruir la autoestima y reducir la confianza personal. Su padecimiento lleva a la despersonalizaci?n, al mismo tiempo que genera dependencia de la persona que los inflige. El maltratador se vale para ello de insultos, acusaciones, amenazas, cr?ticas destructivas, gritos, manipulaciones, silencios, indiferencias y desprecios. ','admin','0000-00-00 00:00:00',1),(175,'Malversaci?n de bienes p?blicos','\"Consiste en darle a bienes que administra una aplicaci?n definitiva diferente de aquella a los que est?n destinados, afectando el servicio o funci?n encomendada.\"\r','admin','0000-00-00 00:00:00',1),(176,'Motin y Falsa Alarma','\"Consiste en la reuni?n tumultuaria contra la disciplina establecida ya sea para exigir con gritos y amenazas la separaci?n de alg?n superior, el pago de la raci?n o hacer en esta forma cualquier petici?n.\"\r','admin','0000-00-00 00:00:00',1),(177,'Omisi?n de Asistencia familiar','Est? comprendido en delitos Contra la Familia y consiste en el incumplimiento de la obligaci?n alimentaria o el abandono de la mujer embarazada.\r','admin','0000-00-00 00:00:00',1),(178,'Pandillas Perniciosas','\"Esta comprendido en los delitos contra la patria potestad y consiste en inducir o instigar a menores de edad en participar en pandillas o act?a como su cabecilla, l?der o jefe.\"\r','admin','0000-00-00 00:00:00',1),(179,'Peculado','\"el funcionario o servidor p?blico que se apropia o utiliza, en cualquier forma, para s? o para otro, caudales o efectos cuya percepci?n, administraci?n o custodia le est?n confiados por raz?n de su cargo.\"\r','admin','0000-00-00 00:00:00',1),(180,'Peligro Com?n','\"Consiste en hechos violentos o fraudulentos que en si mismo o en su consecuencias comprometen la seguridad p?blica, dando lugar a una situaci?n de peligro com?n incierto e indeterminado.\"\r','admin','0000-00-00 00:00:00',1),(181,'Peligro Com?n (conducci?n en estado de ebriedad o drogadicci?n)','\"El que encontr?ndose en estado de ebriedad ? drogadicci?n conduce, opera o maniobra veh?culo motorizado, instrumento, herramienta, m?quina u otro an?logo, ser? reprimido con pena privativa de libertad no mayor de un a?o e inhabilitaci?n (suspensi?n o cancelaci?n de la autorizaci?n para conducir cualquier tipo de veh?culo).\"\r','admin','0000-00-00 00:00:00',1),(182,'Peligro por medio de incendio o explosi?n ','\"El que crea un peligro com?n para las personas o los bienes mediante incendio, explosi?n o liberando cualquier clase de energ?a, ser? reprimido con pena privativa de libertad.\"\r','admin','0000-00-00 00:00:00',1),(183,'Proxenetismo','\"Esta comprendido dentro de los delitos contra la libertad y consiste en el que compromete, seduce, o sustrae a una persona para entregarla a otro con el objeto de practicar relaciones sexuales, o el que la entrega con este fin.\"\r','admin','0000-00-00 00:00:00',1),(184,'Receptaci?n','\"Es el que adquiere, recibe en donaci?n o en prenda o guarda, esconde, vende o ayuda a negociar un bien de cuya procedencia delictuosa ten?a conocimiento o deb?a presumir que proven?a de un delito.\"\r','admin','0000-00-00 00:00:00',1),(185,'Robo','\"Consiste en apoderarse ileg?timante de un bien mueble, total o parcialmente ajeno, para aprovecharse de ?l substray?ndolo del lugar donde se encuentra mediante el empleo de la violencia contra la personal o bajo amenaza de un peligro inminente para su vida o su integridad f?sica.\"\r','admin','0000-00-00 00:00:00',1),(186,'Robo Agravado ','\"Consiste en apoderarse ileg?timamente de un bien mueble, total o parcialmente ajeno, para aprovecharse de ?l, substray?ndolo del lugar donde se encuentra, mediante el empleo de la violencia contra la persona o bajo amenaza de un peligro inminente para su vida.\"\r','admin','0000-00-00 00:00:00',1),(187,'Robo Calificado ','\"De acuerdo al c?digo Penal est? contemplado en delitos Contra el Patrimonio y consiste en apoderarse ileg?timamente de un bien mueble, total o parcialmente ajeno para aprovecharse de ?l, substray?ndolo del lugar en que se encuentra mediante el empleo de la violencia.\"\r','admin','0000-00-00 00:00:00',1),(188,'Robo Sistematico','\"consiste en apoderarse ileg?timamente de un bien mueble, total o parcialmente ajeno, substray?ndolo continuamente.\"\r','admin','0000-00-00 00:00:00',1),(189,'Seducci?n','\"Consiste en instigar a una persona, perturb?ndola o amenaz?ndola af?n de alcanzar prop?sitos personales.\"\r','admin','0000-00-00 00:00:00',1),(190,'Tenencia ilegal de armas','\"Est? comprendido en delitos contra la seguridad p?blica y consiste en poseer armas de fuego (pistolas, escopetas, revolver Etc.) sin la debida autorizaci?n.\"\r','admin','0000-00-00 00:00:00',1),(191,'Terrorismo','Est? tipificado en delitos conta la tranquilidad p?blica y consiste en la perturbaci?n de la tranquilidad p?blica mediantes actos de violencia o apologia.\r','admin','0000-00-00 00:00:00',1),(192,'Tr?fico de Productos Nocivos para la Salud','Consiste en transportar sustancias peligrosas nocivas para la salud de las personas sin las debidas medidas de seguridad y permisos correspondientes.\r','admin','0000-00-00 00:00:00',1),(193,'Trafico Il?cito de Drogas','\"Est? tipificado en delitos contra la Salud p?blica y consiste en la comercializaci?n, distribuci?n, almacenamiento, elaboraci?n de Drogas Prohibidas.\"\r','admin','0000-00-00 00:00:00',1),(194,'Trafico Il?cito de drogas Atenuado','Consiste en poseer drogas en cantidad personal para su propio e inmediato consumo.\r','admin','0000-00-00 00:00:00',1),(195,'Tortura','\"El funcionario o servidor p?blico o cualquier persona, con el consentimiento o aquiescencia de aqu?l, que inflija a otro dolores o sufrimientos graves, sean f?sicos o mentales, o lo someta a condiciones o m?todos que anulen su personalidad o disminuyan su capacidad f?sica o mental, aunque no causen dolor f?sico o aflicci?n ps?quica, con el fin de obtener de la v?ctima o de un tercero una confesi?n o informaci?n, o de castigarla por cualquier hecho que haya cometido o se sospeche que ha cometido, o de intimidarla o de coaccionarla, ser? reprimido con pena privativa de libertad no menor de cinco ni mayor de diez a?os.\"\r','admin','0000-00-00 00:00:00',1),(196,'Ultraje a SÃ­mbolos, prÃ³ceres o heroes de la patria','\\\"De acuerdo al c?digo Penal est? contemplado en delitos Contra los s?mbolos y valores de la patria y consiste en el que, p?blicamente o por cualquier medio de difusi?n, ofende, ultraja, vilipendia o menosprecia, por obra o por expresi?n verbal, los s?mbolos de la Patria o la memoria de los pr?ceres o h?roes que nuestra historia consagra, ser? reprimido con pena privativa de libertad no mayor de cuatro a?os y con sesenta a ciento ochenta d?as-multa.\\\"','admin','0000-00-00 00:00:00',1),(197,'Usurpaci?n','\"Consiste en el despojo de la posesi?n o tenencia de un inmueble o del ejercicio de un derecho real, por medio de la violencia, amenaza, enga?o o abuso de confianza\"\r','admin','0000-00-00 00:00:00',1),(198,'Violaci?n de Domicilio','\"Consiste en penetrar o permanecer en casa ajena sin el consentimiento del due?o o morador, haci?ndose uso de la fuerza en caso necesario.\"\r','admin','0000-00-00 00:00:00',1),(199,'Violaci?n de la libertad Personal-Coaccion','\"Esta contemplado dentro de los delitos contra la libertad y consiste que una persona mediante amenaza o violencia, obliga a otro a hacer lo que la ley no manda o le impide hacer lo que ella no proh?be.\"\r','admin','0000-00-00 00:00:00',1),(200,'Violaci?n de la libertad Personal-Retenci?n o traslado de menor de edad o de persona incapaz ','\"Esta contemplado en los delitos contra la libertad y consiste en retener o traslada de un lugar a otro a un menor de edad o a una persona incapaz de valerse por si misma, empleando violencia, amenaza, enga?o u otro acto fraudulento, con la  finalidad de obtener ventaja econ?mica o explotar social o econ?micamente a la v?ctima\"\r','admin','0000-00-00 00:00:00',1),(201,'Violaci?n de la libertad Personal-Secuestro','\"Esta contemplado en los delitos contra la libertad y consiste en que, sin derecho, motivo ni facultad justificada, priva a otro de su libertad personal, cualquiera sea el m?vil, el prop?sito, la modalidad o circunstancia o tiempo que el agraviado sufra la privaci?n o restricci?n de su libertad.\"\r','admin','0000-00-00 00:00:00',1),(202,'Violaci?n de la libertad sexual','\"Esta contemplado en los delitos contra la libertad, obligando a otra persona a practicar el acto sexual u otro an?logo, mediante la violencia, amenaza, enga?o, abuso de confianza ? grave amenaza para su vida o su integridad f?sica.\"\r','admin','0000-00-00 00:00:00',1),(203,'Violaci?n de libertad de trabajo','\"Consiste en obligar a otra persona mediante violencia o amenaza a prestar trabajo sin recibir una retribuci?n, integrar un sindicato o trabajar sin las condiciones de seguridad.\"\r','admin','0000-00-00 00:00:00',1),(204,'Violencia y resistencia a la autoridad','EstÃ¡ contemplado en delitos Contra la AdministraciÃ³n PÃºblica y consiste en la intimidaciÃ³n, violencia, resistencia y desobediencia a una orden impartida por un funcionario pÃºblico en el ejercicio de sus atribuciones.','admin','0000-00-00 00:00:00',1),(205,'ViolenciÃ³n de secreto de estado','El que revela o hace accesible a un Estado extranjero o a sus agentes o al pÃºblico, secretos que el interÃ©s de la RepÃºblica exige guardarlos','admin','0000-00-00 00:00:00',1),(206,'INTERDICCION CIVIL','Es la declaracion judicial de incapacidad de ejerccio de una persona mayor de edad.','cbazan','2010-09-21 10:14:56',1),(207,'MALTRATO FISICO','EstÃ¡ contemplado en delitos contra la vida, el cuerpo y la salud, consiste en causar da?os o heridas en el cuerpo o la salud de una persona.','cbazan','2010-09-21 10:16:06',1),(208,'DELITO CONTRA LA PAZ PUBLICA - DISTURBIOS','El que en una reunion tumultuaria, atenta contra la integridad fisica de las personas y/o mediante violencia causa grabe daÃ±o a la propiedad publica o privada, sera reprimido con pena privativa de libertad no menor de 3 ni mayor de 6 aÃ±os','cbazan','2010-09-21 10:18:32',1),(209,'VIOLACIÃ“N DEL SECRETO PROFESIONAL','El que.teniendo informaciÃ³n por razÃ³n de su estado, oficio, empleo, profesiÃ³n o ministerio, de secretos cuya publicaciÃ³n pueda causar daÃ±o, los revela sin consentimiento del interesado, serÃ¡ reprimido con pena privativa de libertad no mayor de dos aÃ±os y con sesenta a ciento veinte dÃ­as-multa.','cbazan','2010-09-27 18:04:09',1);

